--Crear secuencias
CREATE SEQUENCE  SEQ_PAISES  MINVALUE 1 MAXVALUE 999999999999999999999999999 INCREMENT BY 1;
CREATE SEQUENCE  SEQ_DEPARTAMENTOS  MINVALUE 1 MAXVALUE 999999999999999999999999999 INCREMENT BY 1;
CREATE SEQUENCE  SEQ_ESTADOS  MINVALUE 1 MAXVALUE 999999999999999999999999999 INCREMENT BY 1;
CREATE SEQUENCE  SEQ_PACIENTES  MINVALUE 1 MAXVALUE 999999999999999999999999999 INCREMENT BY 1;
