-- Crear tablas
CREATE TABLE PAISES
   (
	   	IDE_PAIS NUMBER NOT NULL ENABLE, 
		NOM_PAIS VARCHAR2(100 BYTE), 
		CONSTRAINT PK_PAISES PRIMARY KEY (IDE_PAIS)
	)
  	TABLESPACE HOSPITAL_BILLS;  

CREATE TABLE DEPARTAMENTOS 
   (
	   	IDE_DEPARTAMENTO NUMBER NOT NULL ENABLE, 
		IDE_PAIS NUMBER NOT NULL ENABLE, 
		NOM_DEPARTAMENTO VARCHAR2(100 BYTE), 
		CONSTRAINT PK_DEPARTAMENTOS PRIMARY KEY (IDE_DEPARTAMENTO),
	  	CONSTRAINT FK_DEPARTAMENTOS_PAIS FOREIGN KEY (IDE_PAIS) REFERENCES PAISES (IDE_PAIS) ENABLE
  	)
   TABLESPACE HOSPITAL_BILLS; 

 CREATE TABLE CIUDADES 
   (
	   	IDE_CIUDAD NUMBER NOT NULL ENABLE, 
		NOM_CIUDAD VARCHAR2(30 BYTE), 
		IDE_DEPARTAMENTO NUMBER NOT NULL ENABLE, 
		CODIGO_POSTAL VARCHAR2(15 BYTE),
		CONSTRAINT PK_MAET_CIUDADES PRIMARY KEY (IDE_CIUDAD),
	  	CONSTRAINT FK_CIUDADES_DEPARTAMENTO FOREIGN KEY (IDE_DEPARTAMENTO) REFERENCES DEPARTAMENTOS (IDE_DEPARTAMENTO) ENABLE
   ) 
   TABLESPACE HOSPITAL_BILLS; 

CREATE TABLE BARRIOS 
   (
	   	IDE_BARRIO NUMBER(*,0) NOT NULL ENABLE, 
		NOM_BARRIO VARCHAR2(30 BYTE), 
		IDE_CIUDAD NUMBER(*,0) NOT NULL ENABLE,
		CONSTRAINT PK_MAET_BARRIOS PRIMARY KEY (IDE_BARRIO),
		CONSTRAINT FK_BARRIOS_CIUDAD FOREIGN KEY (IDE_CIUDAD) REFERENCES CIUDADES (IDE_CIUDAD) ENABLE
	)
   TABLESPACE HOSPITAL_BILLS;
 
CREATE TABLE TIPOS_IDENTIFICACION 
   (
    IDE_TIPO_IDENTIFICACION VARCHAR2(5 BYTE) NOT NULL ENABLE, 
    NOM_TIPO_IDENTIFICACION VARCHAR2(30 BYTE), 
		CONSTRAINT PK_TIPOS_IDENTIFICACION PRIMARY KEY (IDE_TIPO_IDENTIFICACION)
	 )
   TABLESPACE HOSPITAL_BILLS;

CREATE TABLE MODULOS_ESTADOS 
   (
	   	IDE_MODULO NUMBER NOT NULL ENABLE, 
		DES_MODULO VARCHAR2(30 BYTE) NOT NULL ENABLE, 
		CONSTRAINT PK_MODULOS_SISTEMA PRIMARY KEY (IDE_MODULO)
	)
   TABLESPACE HOSPITAL_BILLS;

CREATE TABLE ESTADOS 
	   (
		   	IDE_ESTADO NUMBER NOT NULL ENABLE, 
			IDE_MODULO NUMBER NOT NULL ENABLE, 
			DES_ESTADO VARCHAR2(50 BYTE) NOT NULL ENABLE, 
			CONSTRAINT PK_ESTADOS PRIMARY KEY (IDE_ESTADO),
			CONSTRAINT FK_ESTADOS_MODULOS FOREIGN KEY (IDE_MODULO) REFERENCES MODULOS_ESTADOS (IDE_MODULO) ENABLE
		)
	   TABLESPACE HOSPITAL_BILLS;

CREATE TABLE PACIENTES 
   (
	   	IDE_PACIENTE NUMBER NOT NULL ENABLE, 
		NUM_IDENTIFICACION VARCHAR2(20 BYTE) NOT NULL ENABLE, 
		NOMBRES VARCHAR2(50 BYTE) NOT NULL ENABLE, 
		APELLIDO1 VARCHAR2(25 BYTE) NOT NULL ENABLE, 
		APELLIDO2 VARCHAR2(25 BYTE), 
		DIRECCION VARCHAR2(50 BYTE), 
		TEL_FIJO VARCHAR2(25 BYTE), 
		TEL_MOVIL VARCHAR2(25 BYTE), 
		IDE_BARRIO NUMBER, 
		FEC_CREACION DATE,
		FEC_MODIFICACION DATE, 
		FEC_NACIMIENTO DATE, 
		SEXO CHAR(1 BYTE), 
		IDE_TIPO_IDENTIFICACION VARCHAR2(5 BYTE),
		EMAIL VARCHAR2(80 BYTE),
		IDE_CIUDAD_RESIDENCIA NUMBER, 
		FEC_EXPEDICION_DOCUMENTO DATE,
		IDE_CIUDAD_EXPEDICION_DOC NUMBER,
		IDE_ESTADO NUMBER,
		CONSTRAINT PK_PAC PRIMARY KEY (IDE_PACIENTE),
		CONSTRAINT FK_PAC_TIPOS_IDENTIF FOREIGN KEY (IDE_TIPO_IDENTIFICACION) REFERENCES TIPOS_IDENTIFICACION (IDE_TIPO_IDENTIFICACION) ENABLE, 
		CONSTRAINT FK_PAC_CIUDAD_RESIDENCIA FOREIGN KEY (IDE_CIUDAD_RESIDENCIA) REFERENCES CIUDADES (IDE_CIUDAD) ENABLE, 
		CONSTRAINT FK_PAC_CIU_EXPEDICION_DOC FOREIGN KEY (IDE_CIUDAD_EXPEDICION_DOC) REFERENCES CIUDADES (IDE_CIUDAD) ENABLE,
		CONSTRAINT FK_PAC_BARRIO FOREIGN KEY (IDE_BARRIO) REFERENCES BARRIOS (IDE_BARRIO) ENABLE,
		CONSTRAINT FK_PAC_ESTADO FOREIGN KEY (IDE_ESTADO) REFERENCES ESTADOS (IDE_ESTADO) ENABLE
	)
   	TABLESPACE HOSPITAL_BILLS;

CREATE TABLE CENTROS_COSTOS
	(
		IDE_CENTRO_COSTOS NUMBER NOT NULL ENABLE,
		NOM_CENTRO_COSTOS VARCHAR2(50 BYTE) NOT NULL ENABLE,
		CONSTRAINT PK_CENTRO_COSTOS PRIMARY KEY (IDE_CENTRO_COSTOS)
	)
	TABLESPACE HOSPITAL_BILLS;

CREATE TABLE SERVICIOS
   (	
   		IDE_SERVICIO NUMBER NOT NULL ENABLE, 
		NOM_SERVICIO VARCHAR2(40 BYTE), 
		VLR_SERVICIO NUMBER DEFAULT 0 NOT NULL ENABLE, 
		IVA_SERVICIO NUMBER(2,0) DEFAULT 0 NOT NULL ENABLE, 
		ACTIVO CHAR(1 BYTE) DEFAULT 'S' NOT NULL ENABLE, 
		IDE_CENTRO_COSTOS NUMBER, 
		FEC_CREACION DATE NOT NULL ENABLE, 
		FEC_INACTIVACION DATE, 
	 	CONSTRAINT PK_SERVICIOS PRIMARY KEY (IDE_SERVICIO),
	 	CONSTRAINT FK_SERVICIOS_CENTRO_COSTOS FOREIGN KEY (IDE_CENTRO_COSTOS) REFERENCES CENTROS_COSTOS (IDE_CENTRO_COSTOS) ENABLE
	)
  	TABLESPACE HOSPITAL_BILLS;
    

CREATE TABLE ADMISIONES
	(
		IDE_ADMISION NUMBER NOT NULL ENABLE,
		IDE_PACIENTE NUMBER NOT NULL ENABLE,
		FEC_ADMISION DATE NOT NULL ENABLE,
		FEC_ALTA DATE,
		IDE_ESTADO_ADMISION NUMBER NOT NULL ENABLE,
		CONSTRAINT PK_ADMISIONES PRIMARY KEY (IDE_ADMISION),
		CONSTRAINT FK_PACIENTES FOREIGN KEY (IDE_PACIENTE) REFERENCES PACIENTES (IDE_PACIENTE),
	 	CONSTRAINT FK_ADMISIONES_ESTADOS FOREIGN KEY (IDE_ESTADO_ADMISION) REFERENCES ESTADOS (IDE_ESTADO) ENABLE
	)
  	TABLESPACE HOSPITAL_BILLS;

CREATE TABLE FACTURAS
	(
		NUM_FACTURA NUMBER NOT NULL ENABLE,
		FEC_FACTURA DATE NOT NULL ENABLE,
		IDE_PACIENTE NUMBER NOT NULL ENABLE,
		IDE_ESTADO_FACTURA NUMBER NOT NULL ENABLE,
		IDE_ADMISION NUMBER NOT NULL ENABLE,
		VLR_SUBTOTAL NUMBER NOT NULL ENABLE,
		VLR_IVA NUMBER,
		VLR_TOTAL_FAC NUMBER NOT NULL ENABLE,
		CONSTRAINT PK_FACTURA PRIMARY KEY (NUM_FACTURA),
		CONSTRAINT FK_FACTURA_PACIENTES FOREIGN KEY (IDE_PACIENTE) REFERENCES PACIENTES (IDE_PACIENTE) ENABLE,
		CONSTRAINT FK_FACTURA_ESTADOS FOREIGN KEY (IDE_ESTADO_FACTURA) REFERENCES ESTADOS (IDE_ESTADO) ENABLE,
		CONSTRAINT FK_FACTURA_ADMISIONES FOREIGN KEY (IDE_ADMISION) REFERENCES ADMISIONES (IDE_ADMISION) ENABLE
	)
	TABLESPACE HOSPITAL_BILLS;

CREATE TABLE FACTURAS_DETALLE
	(
		IDE_DETALLE NUMBER NOT NULL ENABLE,
		NUM_FACTURA NUMBER NOT NULL ENABLE,
		IDE_SERVICIO NUMBER NOT NULL ENABLE,
		FEC_SERVICIO DATE NOT NULL ENABLE,
		VLR_SERVICIO NUMBER NOT NULL ENABLE,
		VLR_IVA_SERVICIO NUMBER (2,0) NOT NULL ENABLE,
		CONSTRAINT PK_DETALLE PRIMARY KEY (IDE_DETALLE),
		CONSTRAINT FK_DETALLE_FACTURA FOREIGN KEY (NUM_FACTURA) REFERENCES FACTURAS (NUM_FACTURA) ENABLE,
		CONSTRAINT FK_DETALLE_SERVICIOS FOREIGN KEY (IDE_SERVICIO) REFERENCES SERVICIOS (IDE_SERVICIO) ENABLE
	)
	TABLESPACE HOSPITAL_BILLS;

